ISLAMABAD, Jun 20 (APP):The National Assembly session, chaired by Speaker Ayaz Sadiq, commenced at 11:05 a.m. on Friday.
The lawmakers are scheduled to continue deliberations on the Finance Bill 2025-26 for the seventh day, with active participation anticipated as members examine various components of the proposed federal budget.
